package Com.data;

public class Demo {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int a=10;
		
		int b=20;
		
		int c=a+b;
		
		int d=a-b;
		
		int e=a*b;
		
		int f=a/b;
		
		System.out.println("Result of + :  "+c);
		System.out.println("Result of - :  "+d);
		System.out.println("Result of * :  "+e);
		System.out.println("Result of / :  "+f);
		
		

	}

}
